INSERT INTO `role` VALUES (2, '管理员', '1、在公司经营战略指导下,制定发展计划及指标,推动并确保指标的顺利完成;2、负责部门的日常管理,建立规范、高效的管理体系及工作流程,建设和发展优秀的队伍; 3、根据公司方针和部门需要,合理设置部门组织结构和岗位,优化工作流程,开发和培养员工能力;4、对员工绩效进行管理,提升部门工作效率,提高员工满意度。', 1);
INSERT INTO `role` VALUES (10, '总经理', '1、负责前台全面工作,创造良好的工作氛围; 2.及时了解员工的思想,检查督导本部门员工的仪表仪容、组织记录、礼貌用语及工作效率; 3.掌握预订情况和当天客情,根据当天到达及离店房客名单,最大限度的销售即时客房;4.督导迎送服务,贯彻执行服务程序,督导问讯服务的进行,满足客人合理的要求。', 1);
INSERT INTO `role` VALUES (11, '财务员', '1、协助上级制定公司的财务规章制度；2、审核单据，包括报销单据、销售单据以及原始凭据，做好财务核算；3、对资金流动进行认真核对，并定期对公司的坏账进行清理。', 1);
INSERT INTO `role` VALUES (12, '人事专员', '1、主要办理人事招聘、人才引进、职称评定、内部调动、解聘、退休、接纳和劳动年检、转移保险、公积金缴纳的相关手续。', 1);
INSERT INTO `role` VALUES (13, '前台', '1、负责出租屋前台接待工作;2、负责公司电话转接、收发传真、文档复印、预定机票酒店等工作; 3、负责员工考勤和外出、请假等各类表单。', 1);
INSERT INTO `role` VALUES (14, '维修员', '1、负责出租屋日常的房屋维修、零星小修工作,为业主提供维修服务。2、遵守公司维修制度规定,高效、优质、安全地完成维修工作。', 1);
